/* Function  structure for function  `get_timeline_status` */

/*!50003 DROP FUNCTION IF EXISTS `get_timeline_status` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`kpibim`@`%` FUNCTION `get_timeline_status`(p_project_id INT) RETURNS varchar(50) CHARSET latin1
BEGIN
	DECLARE s VARCHAR(50);
	DECLARE counter INT(5);
    
	    SELECT COUNT(1) INTO counter FROM `schedule` WHERE project_id = p_project_id;
	    
	    IF counter < 1
	    THEN
		SET s = 'NOT_STARTED';
	    ELSE
		SELECT CASE c.`status` 
	    WHEN 0 THEN 'RUNNING' 
	    WHEN 1 THEN 'PAUSED' 
	    WHEN 2 THEN 'STOPPED'	
	    ELSE 'NOT_DEFINED' END INTO s FROM `schedule` c 
	    WHERE c.project_id = p_project_id AND c.`schedule_id` = (SELECT MAX(schedule_id) from `schedule` 
		WHERE project_id = c.project_id); 
	    END IF;
	    RETURN s;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `spgetproject` */

/*!50003 DROP PROCEDURE IF EXISTS  `spgetproject` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`kpibim`@`%` PROCEDURE `spgetproject`()
BEGIN
	SELECT distinct PROJECT_NAME, PROJECT_DETAIL_ID FROM project group BY PROJECT_NAME ASC;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `spgetProjectfromunit` */

/*!50003 DROP PROCEDURE IF EXISTS  `spgetProjectfromunit` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`kpibim`@`%` PROCEDURE `spgetProjectfromunit`(IN p_UNIT_ID INT)
BEGIN
	SELECT PROJECT_DETAIL_ID, PROJECT_NAME 
		from project where UNIT_ID = p_UNIT_ID
		group by PROJECT_NAME asc;
    END */$$
DELIMITER ;

